  false,\n\t\"url\": null,\n\t\"notes\": \"Municipal and State code violation notices
  issued by the Department of Environment (DOE) from January, 1993 to December 31,
  2012 and by the Department of Public Health (CDPH) Permitting and Inspections unit
  since January 1, 2012. On January 1, 2012, the DOE was disbanded and all its inspection,
  permitting, and enforcement authorities were transferred to the CDPH.   rnData fields
  requiring description are detailed below. rnMAPPED LOCATION: Contains latitude/longitude
  coordinates of the site as determined through the Chicago Open Data Portalu2019s
  geocoding engine. In instances where the facility address is a range, the lower
  number (the value in the u201cStreet Number Fromu201d column) is used for geocoding.
  For example, for the range address 1000-1005 S Wabash Ave, the Mapped Location would
  be the coordinates for 1000 S Wabash Ave. rn DOCKET NO:  This the unique identifier
  assigned to the case. A docket number can contain multiple tickets. rnTICKET NO:
  This is the unique identifier of the issued ticket. A ticket can contain up to two
  code violations.rnRESPONDENT: The name of the entity issued the code violation notice.
  \ rnCASE TYPE: The Case Types are historic 3-Day Notice, Air Pollution Defect Notice,
  Administrative Hearing, Summary Abatement, Chicago Storage Tank NOV, State Administrative
  Citation, State Violation Notice, historic Pre Enforcement Conference, and historic
  Ticket-Municipal Prosecution.trnVIOLATION DATE: The date of the code violation.
  \ rnCODE VIOLATION: The municipal or state code being cited in the ticket. rnDISPOSITION:
  The outcome of the individual code violation. rnCASE STATUS: The final or most current
  status of the case.   rnFINE AMONT: This is the total fine assessed for the case
  not including court fees. Note that this value is not unique to the record but applies
  to the entire case. For example, the case with a Docket No of 07DE000171 has two
  records with a Fine Amount of $350 in each record. The total fine on the case is
  $350, not the sum of $700.rnCOMMENT: Additional information relating to the violation
  or case. rnDATA SOURCE: The city department that collected the data.\",\n\t\"owner_org\":
